import Mensaje from './Mensaje.js'


const Description = () =>{
  return <p>Esta es la app del curso fullstack bootcamp</p>
}

const App=()=>{
  return (
    <div className="App">
      <Mensaje color='red' msg='Estamos trabajando'/>
      <Mensaje colore='green' msg='En un curso' />
      <Mensaje color='yellow' msg='De React' />
      <Description/>
    </div>
  );
}

export default App;
